      "source" => "parseTransaction (transaction: Dict, currency: Currency = undefined): Transaction {\n        //\n        // fetchDeposits (private)\n        //\n        //      {\n        //          \"insertTime\":1649012310000,\n        //          \"amount\":9.00000000000000000000,\n        //          \"address\":\"TYASr5UV6HEcXatwdFQfmLVUqQQQMUxHLS\",\n        //          \"networkName\":\"trc20\",\n        //          \"txId\":\"081e4e9351dd0274922168da5f2d14ea6c495b1c3b440244f4a6dd9fe196bf2b\",\n        //          \"coin\":\"usdt\",\n        //          \"status\":\"2\"\n        //      }\n        //\n        //\n        // fetchWithdrawals (private)\n        //\n        //      {\n        //          \"amount\":2.00000000000000000000,\n        //          \"address\":\"TBjrW5JHDyPZjFc5nrRMhRWUDaJmhGhmD6\",\n        //          \"fee\":1.00000000000000000000,\n        //          \"networkName\":\"trc20\",\n        //          \"coid\":\"usdt\",\n        //          \"transferType\":\"\",\n        //          \"txId\":\"47eeee2763ad49b8817524dacfa7d092fb58f8b0ab7e5d25473314df1a793c3d\",\n        //          \"id\":1902194,\n        //          \"applyTime\":1649014002000,\n        //          \"status\":\"4\"\n        //      }\n        //\n        const id = this.safeString (transaction, 'id');\n        let type = undefined;\n        if (id === undefined) {\n            type = 'deposit';\n        } else {\n            type = 'withdrawal';\n        }\n        const txid = this.safeString (transaction, 'txId');\n        const timestamp = this.safeInteger2 (transaction, 'insertTime', 'applyTime');\n        const address = this.safeString (transaction, 'address');\n        let addressFrom = undefined;\n        let addressTo = undefined;\n        if (type === 'deposit') {\n            addressFrom = address;\n        } else {\n            addressTo = address;\n        }\n        const amount = this.safeNumber (transaction, 'amount');\n        const currencyId = this.safeString2 (transaction, 'coin', 'coid');\n        const code = this.safeCurrencyCode (currencyId, currency);\n        const status = this.parseTransactionStatus (this.safeString (transaction, 'status'), type);\n        let fee = undefined;\n        const feeCost = this.safeNumber (transaction, 'fee');\n        if (feeCost !== undefined) {\n            fee = {\n                'cost': feeCost,\n                'currency': code,\n            };\n        }\n        return {\n            'info': transaction,\n            'id': id,\n            'txid': txid,\n            'timestamp': timestamp,\n            'datetime': this.iso8601 (timestamp),\n            'network': this.networkIdToCode (this.safeString (transaction, 'networkName')),\n            'address': address,\n            'addressTo': addressTo,\n            'addressFrom': addressFrom,\n            'tag': undefined,\n            'tagTo': undefined,\n            'tagFrom': undefined,\n            'type': type,\n            'amount': amount,\n            'currency': code,\n            'status': status,\n            'updated': undefined,\n            'comment': undefined,\n            'internal': (status === 'transfer'),\n            'fee': fee,\n        };\n    }"
